import "../App.css";
import React from 'react';
import Header from '../components/Header';
import Button from '../components/button';
import { useHistory } from "react-router-dom";

function home(){
  const history = useHistory();

  return (
    <div className="App">
      <Header title="Doodly"/>
      <div id="choice">
        <Button clicked={() => {history.push("/canvas")}} title="New Canvas"/>
        <Button title="Load Canvas"/>
      </div>
    </div>
  )
}

export default home
